import { Injectable } from '@angular/core';
import { fetchAuthSession, getCurrentUser as amplifyGetCurrentUser, signOut as amplifySignOut } from '@aws-amplify/auth';

@Injectable({
  providedIn: 'root'
})
export class GraphQLClientService {
  private endpoint = '';

  constructor() {
    this.initializeClient();
  }

  private async initializeClient() {
    // Import AWS configuration
    let awsExports: Record<string, any>;
    try {
      awsExports = (await import('../../aws-exports.js')).default;
      this.endpoint = awsExports['API']?.GraphQL?.endpoint || awsExports['aws_appsync_graphqlEndpoint'] || '';
    } catch {
      console.warn('AWS exports not found, using fallback configuration');
      this.endpoint = 'https://localhost:3000/graphql';
    }
  }

  // Simple GraphQL query method
  async query(query: string, variables?: Record<string, any>) {
    try {
      const session = await fetchAuthSession();
      const token = session.tokens?.idToken?.toString();

      const response = await fetch(this.endpoint, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': token ? `Bearer ${token}` : '',
          'x-user-timezone': Intl.DateTimeFormat().resolvedOptions().timeZone,
        },
        body: JSON.stringify({
          query,
          variables
        })
      });

      const result = await response.json();

      if (result.errors) {
        console.error('GraphQL errors:', result.errors);
        // Handle authentication errors
        if (result.errors.some((error: { message: string }) => 
          error.message.includes('Unauthorized') || error.message.includes('Authentication')
        )) {
          console.log('Authentication error detected, signing out...');
          await this.signOut();
        }
      }

      return result;
    } catch (error) {
      console.error('GraphQL request failed:', error);
      throw error;
    }
  }

  // Helper method to get current user
  async getCurrentUser() {
    try {
      return await amplifyGetCurrentUser();
    } catch (error) {
      console.error('Error getting current user:', error);
      throw error;
    }
  }

  // Helper method to sign out
  async signOut() {
    try {
      await amplifySignOut();
    } catch (error) {
      console.error('Error signing out:', error);
      throw error;
    }
  }
}

import { ApolloClient, InMemoryCache, createHttpLink, from } from '@apollo/client';
import { setContext } from '@apollo/client/link/context';
import { onError } from '@apollo/client/link/error';
import { fetchAuthSession } from 'aws-amplify/auth';
import awsExports from '../aws-exports.js';

// HTTP link to GraphQL endpoint
const httpLink = createHttpLink({
  uri: awsExports.aws_appsync_graphqlEndpoint,
});

// Authentication link
const authLink = setContext(async (_, { headers }) => {
  try {
    // Get the current user session using Amplify v6 API
    const session = await fetchAuthSession();
    const token = session.tokens?.idToken?.toString();

    return {
      headers: {
        ...headers,
        authorization: token ? `Bearer ${token}` : "",
        'x-user-timezone': Intl.DateTimeFormat().resolvedOptions().timeZone,
      }
    };
  } catch (error) {
    console.log('No authenticated user:', error);
    return {
      headers: {
        ...headers,
        'x-user-timezone': Intl.DateTimeFormat().resolvedOptions().timeZone,
      }
    };
  }
});

// Error handling link
const errorLink = onError(({ graphQLErrors, networkError }) => {
  if (graphQLErrors) {
    graphQLErrors.forEach(({ message, locations, path }) =>
      console.log(
        `[GraphQL error]: Message: ${message}, Location: ${locations}, Path: ${path}`
      )
    );
  }

  if (networkError) {
    console.log(`[Network error]: ${networkError}`);

    // Handle authentication errors
    if ('statusCode' in networkError && networkError.statusCode === 401) {
      // Redirect to login or refresh token
      console.log('Authentication error - redirecting to login');
    }
  }
});

// Create Apollo Client
export const apolloClient = new ApolloClient({
