export class UsersComponent implements OnInit {
  userRecords: UserRecord[] = [];
  loading = true;
  error = '';
  showDialog = false;
  isEditing = false;
  submitting = false;
  editingUser: UserRecord | null = null;

  userForm: UserForm = {
    name: '',
    email: '',
    bio: '',
    role: 'user'
  };

  constructor(private graphqlClient: GraphQLClientService) {}

  ngOnInit() {
    this.loadUsers();
  }

  async loadUsers() {
    this.loading = true;
    this.error = '';

    try {
      console.log('=== LOADING USER RECORDS ===');
      console.log('1. About to query listUsers...');
      const result = await this.graphqlClient.query(listUsers, {});
      console.log('2. User records query result:', JSON.stringify(result, null, 2));

      if (result.data && result.data.listUsers) {
        this.userRecords = result.data.listUsers;
        console.log('3. Successfully loaded user records:', this.userRecords.length, 'records');
      } else {
        console.warn('3. No user records data in result:', result);
        this.userRecords = [];
      }
      console.log('=== END LOADING USER RECORDS ===');
    } catch (err: any) {
      console.error('=== USER RECORDS ERROR ===');
      console.error('Error loading User records:', err);
      console.error('Error details:', {
        message: err?.message,
        stack: err?.stack,
        name: err?.name
      });
      console.error('=== END USER RECORDS ERROR ===');
      this.error = err?.message || 'Failed to load users';
      this.userRecords = [];
    } finally {
      this.loading = false;
    }
  }

  refreshUsers() {
    this.loadUsers();
  }

  getUserInitials(user: UserRecord): string {
    const nameParts = user.name.split(' ');
    if (nameParts.length >= 2) {
      return (nameParts[0].charAt(0) + nameParts[1].charAt(0)).toUpperCase();
    }
    return user.name.charAt(0).toUpperCase() || 'U';
  }

  getRoleBadgeClass(role: string): string {
    switch (role.toLowerCase()) {
      case 'admin':
        return 'bg-red-100 text-red-800';
      case 'moderator':
        return 'bg-yellow-100 text-yellow-800';
      case 'user':
      default:
        return 'bg-green-100 text-green-800';
    }
  }

  formatDate(dateString: string): string {
    return new Date(dateString).toLocaleDateString();
  }

  openCreateDialog() {
    this.isEditing = false;
    this.editingUser = null;
    this.userForm = {
      name: '',
      email: '',
      bio: '',
      role: 'user'
    };
    this.showDialog = true;
  }

  openEditDialog(user: UserRecord) {
    this.isEditing = true;
    this.editingUser = user;
    this.userForm = {
      name: user.name,
      email: user.email,
      bio: user.bio || '',
      role: user.role
    };
    this.showDialog = true;
  }

  closeDialog() {
    this.showDialog = false;
    this.editingUser = null;
    this.submitting = false;
  }

  async submitUserForm() {
    if (this.submitting) return;

    this.submitting = true;

    try {
      const input = {
        name: this.userForm.name,
        email: this.userForm.email,
        bio: this.userForm.bio,
        role: this.userForm.role
      };

      if (this.isEditing && this.editingUser) {
        const result = await this.graphqlClient.mutate(updateUser, {
          input: { ...input, id: this.editingUser.id }
        });
        console.log('Update user result:', result);
      } else {
        const result = await this.graphqlClient.mutate(createUser, { 
          input 
        });
        console.log('Create user result:', result);
      }

      this.closeDialog();
      await this.loadUsers(); // Refresh user records
    } catch (err: any) {
      this.error = err?.message || 'Failed to save user';
      console.error('Error saving user:', err);
      alert('Failed to save user: ' + (err?.message || 'Unknown error'));
    } finally {
      this.submitting = false;
    }
  }

  async deleteUser(user: UserRecord) {
    if (!confirm(`Are you sure you want to delete "${user.name}"?`)) {
      return;
    }

    try {
      const result = await this.graphqlClient.mutate(deleteUser, {
        input: { id: user.id }
      });

      console.log('Delete user result:', result);
      await this.loadUsers(); // Refresh the list
    } catch (err: any) {
      this.error = err?.message || 'Failed to delete user';
      console.error('Error deleting user:', err);
      alert('Failed to delete user: ' + (err?.message || 'Unknown error'));
    }
  }
}

