      console.error('Error details:', {
        message: err?.message,
        stack: err?.stack,
        name: err?.name
      });
      console.error('=== END USER RECORDS ERROR ===');
      this.userRecords = [];
    }
  }

  refreshUsers() {
    this.loadUsers();
  }

  getUserInitials(cognitoUser: CognitoUser): string {
    const givenName = this.getAttribute(cognitoUser, 'given_name') || '';
    const familyName = this.getAttribute(cognitoUser, 'family_name') || '';
    return (givenName.charAt(0) + familyName.charAt(0)).toUpperCase() || 'U';
  }

  getUserDisplayName(cognitoUser: CognitoUser): string {
    const givenName = this.getAttribute(cognitoUser, 'given_name') || '';
    const familyName = this.getAttribute(cognitoUser, 'family_name') || '';
    return `${givenName} ${familyName}`.trim() || cognitoUser.Username;
  }

  getUserEmail(cognitoUser: CognitoUser): string {
    return this.getAttribute(cognitoUser, 'email') || '';
  }

  private getAttribute(cognitoUser: CognitoUser, name: string): string {
    const attr = cognitoUser.Attributes.find(a => a.Name === name);
    return attr ? attr.Value : '';
  }

  getStatusBadgeClass(cognitoUser: CognitoUser): string {
    switch (cognitoUser.UserStatus) {
      case 'CONFIRMED':
        return 'bg-green-100 text-green-800';
      case 'UNCONFIRMED':
        return 'bg-yellow-100 text-yellow-800';
      case 'FORCE_CHANGE_PASSWORD':
        return 'bg-orange-100 text-orange-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  }

  formatDate(dateString: string): string {
    return new Date(dateString).toLocaleDateString();
  }

  hasUserRecord(cognitoId: string): boolean {
    return this.userRecords.some(user => user.cognitoId === cognitoId);
  }

  getUserRecord(cognitoId: string): UserRecord | undefined {
    return this.userRecords.find(user => user.cognitoId === cognitoId);
  }

  openProvisionDialog(cognitoUser: CognitoUser) {
    this.selectedCognitoUser = cognitoUser;
    this.isEditing = false;
    this.userForm = {
      name: this.getUserDisplayName(cognitoUser),
      email: this.getUserEmail(cognitoUser),
      bio: '',
      role: 'user'
    };
    this.showDialog = true;
  }

