    try {
      const input = {
        name: this.userForm.name,
        email: this.userForm.email,
        bio: this.userForm.bio,
        role: this.userForm.role,
        cognitoId: this.selectedCognitoUser.Username
      };

      if (this.isEditing) {
        const userRecord = this.getUserRecord(this.selectedCognitoUser.Username);
        if (userRecord) {
          const result = await this.graphqlClient.mutate(updateUser, {
            input: { ...input, id: userRecord.id }
          });
          console.log('Update user result:', result);
        }
      } else {
        const result = await this.graphqlClient.mutate(createUser, { 
          input 
        });
        console.log('Create user result:', result);
      }

      this.closeDialog();
      await this.loadUserRecords(); // Refresh user records
    } catch (err: any) {
      this.error = err?.message || 'Failed to save user profile';
      console.error('Error saving user profile:', err);
      alert('Failed to save user profile: ' + (err?.message || 'Unknown error'));
    } finally {
      this.submitting = false;
    }
  }

  async submitCognitoUserForm() {
    if (this.submitting) return;

    this.submitting = true;

    try {
      const session = await fetchAuthSession();
      const token = session.tokens?.accessToken?.toString();

      if (!token) {
        throw new Error('No authentication token available');
      }

      const response = await fetch('/api/admin/cognito/users', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(this.cognitoUserForm)
      });

      if (!response.ok) {
        throw new Error(`Failed to create Cognito user: ${response.statusText}`);
      }

      this.closeCreateCognitoDialog();
      await this.loadCognitoUsers(); // Refresh Cognito users
    } catch (err: any) {
      this.error = err?.message || 'Failed to create Cognito user';
      console.error('Error creating Cognito user:', err);
    } finally {
      this.submitting = false;
    }
  }

  viewUserDetails(cognitoUser: CognitoUser) {
